import {client} from '../../server'


export const insertPriceData = async(req,res) =>{
    try{
        const {company_code,country_code,station_code,fuel_name,price_date,fuel_price}=req.body;
        const data= await client.query(`INSERT INTO fuel_name_price (
            company_code,country_code,station_code,fuel_name,price_date,fuel_price)VALUES('${company_code}', '${country_code}', '${station_code}','${fuel_name}','${price_date}','${fuel_price}')`)

        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'something wrong'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data added successfully',
            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}

export const countryData = async(req,res) =>{
    try{

        const data= await client.query(`select * from licence_country ORDER BY id ASC`)
        // console.log(data);
        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'data not found'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data find successfully',
                data:data.rows,
            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}
export const companyData = async(req,res) =>{
    try{
        const {contryId}= req.body;
        const data= await client.query(`select * from licence_company where country_id='${contryId}'`)
        // console.log(data);
        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'data not found'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data find successfully',
                data:data.rows,

            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}

export const stationData = async(req,res) =>{
    try{
        const {companyId}= req.body;
        const data= await client.query(`select id,company_code,station_code,station_name from licence_station where company_code='${companyId}'`)
        // console.log(data);
        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'data not found'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data find successfully',
                data:data.rows,
            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}

export const priceData = async(req,res) =>{
    try{
        const {stationId}= req.body;
        const data= await client.query(`select * from fuel_name_price WHERE station_code='${stationId}' `)
        console.log(data);
        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'data not found'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data find successfully',
                data:data.rows,
            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}

export const fuelData = async(req,res) =>{
    try{
        const data= await client.query(`select id,fuel_name from fuel_name ORDER BY id ASC`)
        // console.log(data);
        if(data.rowCount<=0){
            res.status(401).send({
                success:false,
                message:'data not found'
            })
        }
        else{
            res.status(201).send({
                success:true,
                message:'data find successfully',
                data:data.rows,
            })
        }
    }
    catch(err){
        res.status(401).send({
            success:false,
            message:err.message
        })
    }
}

